import React from 'react';

const Navbar = () => {
  return (
    <div>
      <ul id='dropdown1' class='dropdown-content'>
        <li>
          <a href='#!'>one</a>
        </li>
        <li>
          <a href='#!'>two</a>
        </li>
        <li class='divider' />
        <li>
          <a href='#!'>three</a>
        </li>
      </ul>
    </div>
  );
};

export default Navbar;
